INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222474497972', 'Fondant au Chocolat', 'Chocolat râpé 41 % (pâte de cacao - sucre - beurre de cacao - émulsifiant : lécithines de tournesol - arôme naturel de vanille) - sucre - farine de blé - cacao en poudre 5% - poudres à lever : diphosphates, carbonates de sodium. Traces de fruits à coque, d\'œufs, de lait et de soja. Les informations en gras sont destinées aux personnes allergiques ou intolérantes. MODE DE PRÉPARATION : Ingrédients à ajouter : 3 oeufs et 100 g de beurre ramolli. Dans un récipient, mélangez la préparation, 3 oeufs et le beurre ramolli avec un 1- batteur électrique (fouet) à vitesse minimale au début puis à vitesse maximale pendant environ 2 minutes jusqu\'à l\'obtention d\'une pâte crémeuse. 2- Versez la pâte dans un moule préalablement graissé (0 24cm) et lissez la surface. 3- Enfournez pendant 12 minutes dans un four préchauffé à 21 OOC (Th. 7) sur la grille du milieu. Vérifiez en fin de cuisson avec une pointe de couteau si la pâte est assez cuite 4- (après 12 minutes le fondant est un peu tendre au milieu). 5- Laissez refroidir le gâteau pendant 5 minutes, puis démoulez-le et laissez-le refroidir sur une grille à pâtisserie. CONSERVATION : A conserver à l\'abri de la chaleur et de l\'humidité. A consommer de préférence avant fin / NO de lot : voir sur le dessus du paquet. Conditionné en Allemagne par RUF LEBENSMITTELWERK KG (49610 QUAKENBRÜCK).', '', '16', '10', '68', '57', '6.3', '5.4', '0.38', '0.149606299212598', '', '0');

